const listNumbers = [1, 2, 4, 6, 8, 10, 12];

function Numbers(props) {
  return listNumbers
    .map((each, i) => <li key={i}>{each}</li>)
    .filter((each, i) => <p>{input.value}</p>);
}

export default Numbers;
